INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8006614631182', 'Pepe al Legno di Melo Affumicato', 'PEPE AL LEGNO DI MELO AFFUMICATO La lenta affumicatura a freddo con legno di melo ne esalta l’aromaticità pungente. Sapore particolare, speciale se utilizzato sulla pasta alla carbonara e in tutte le pietanze che necessitano dell\'aroma classico dell’affumicatura. (GB) APPLEWOOD SMOKED PEPPER The slow cold smoking process with applewood enhances its pungent aroma. Its unique taste, is excellent on Pasta Carbonara and on all the dishes that need the smoky flavor. (F) POIVRE FUMÉ AU BOIS DE POMMIER Le fumage à froid lente avec du bois de pomme améliore son arôme piquant. Avec une saveur particulier, il et spécial lorsqu’il est utilisé sur les påtes Carbonara et dans les plats qui nécessitent de larome classique de fumer. Conservare in luogo fresco e asciutto lontano da fonti di calore e luce diretta. Store in  a cool and dry place away from light and heat. A conserver à labri de la chaleur, de l’humidité et de la lumière directe. La Cellina Toscana S.p.A. Viale Europa 3, IT-52018 Gastel San Niccolò (AR)', 'https://static.openfoodfacts.org/images/products/800/661/463/1182/front_it.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

